import axios from 'axios'

const list = () => axios.get(`http://localhost:8080/works/list`)
const register = () => axios.post(`http://localhost:8080/works/register`)
const read = () => axios.get(`http://localhost:8080/works/read`)
const modify= () => axios.put(`http://localhost:8080/works/modify`)
const del = () => axios.delete(`http://localhost:8080/works/delete`)

export default { list, register, read, modify, del }
